    'EDICTORafael Huerta García , el Letrado de la Administración de Justicia del Juzgado de lo Mercantil nº 07 de Barcelona al objeto de dar publicidad al auto de declaración de concurso dictado por este órgano judicial, hago saber:Número de asunto. Concurso sin masa 1292/2023 Sección: ANIG: 0801947120238015067Fecha de presentación de la solicitud: 17/11/2023Fecha del auto de declaración. 9 de enero de 2024.Clase de concurso. voluntario sin masa.Entidad concursada. JAVIER JESUS CHAVEZ SAUCEDO, con 51810527Z.El pasivo total es de 291.306,61 eurosLlamamiento a los acreedores. Llamamiento al acreedor o a los acreedores que representen, al menos, el cinco por ciento del pasivo a fin de que, en el plazo de quince días a contar del siguiente a la publicación del edicto, puedan solicitar el nombramiento de un administrador concursal para que presente informe razonado y documentado sobre los siguientes extremos:1.º Si existen indicios suficientes de que el deudor hubiera realizado actos perjudiciales para la masa activa que sean rescindibles conforme a lo establecido en esta ley.2.º Si existen indicios suficientes para el ejercicio de la acción social de responsabilidad contra los administradores o liquidadores, de derecho o de hecho, de la persona jurídica concursada, o contra la persona natural designada por la persona jurídica administradora para el ejercicio permanente de las funciones propias del cargo de administrador persona jurídica y contra la persona, cualquiera que sea su denominación, que tenga atribuidas facultades de más alta dirección de la sociedad cuando no exista delegación permanente de facultades del consejo en uno o varios consejeros delegados.3.º Si existen indicios suficientes de que el concurso pudiera ser calificado de culpable.En el caso de que, dentro de plazo, acreedor o acreedores que representen, al menos, el cinco por ciento del pasivo formularan solicitud de nombramiento de administrador concursal para que emita el informe, el juez, mediante auto, procederá al nombramiento para que, en el plazo de un mes a contar desde la aceptación, emita el informe solicitado. En el mismo auto fijará la retribución del administrador por la emisión del informe encomendado, cuya satisfacción corresponderá al acreedor o acreedores que lo hubieran solicitado.En el caso de que, dentro de plazo, ningún legitimado hubiera formulado esa solicitud, el deudor que fuera persona natural podrá presentar solicitud de exoneración del pasivo insatisfecho en los términos del art. 501 del TRLC.Dirección electrónica del Registro Público concursal donde se publicarán las resoluciones que traigan causa del concurso: https://www.publicidadconcursal.esBarcelona, 10 de enero de 2024.- El/La Letrado/a de la Administración de Justicia, RAFAEL HUERTA GARCIA',
