    'La administración concursal ha presentado el informe a que serefieren los arts. 292 y ss de la Ley Concursal (LC)Barcelona, 10 de enero de 2024.- El/La Letrado/a de la Administración de Justicia, ALFREDO VILLAESCUSA GARCIA',
    'M.José Hompanera González , el Letrado de la Administración de Justicia del Juzgado de lo Mercantil nº 12 de Barcelona hago saber que:En el procedimiento indicado, el día 10 de octubre de 2023 se ha dictado una resolución con el tenor literal siguiente:DILIGENCIA DE ORDENACIÓNLetrado de la Administración de Justicia que la dicta: M.José Hompanera GonzálezLugar: BarcelonaFecha: 10 de octubre de 2023El anterior escrito presentado por la administración concursal en el que solicita la conclusión de concurso y aporta la rendición de cuentas, queda incorporado al procedimiento.Acuerdo que el informe final presentado por la administración concursal quede de manifiesto en la Oficina judicial para conocimiento de las personas interesadas.Conforme al art. 478.3 LC acuerdo remitir el escrito de rendición de cuentas al Registro público concursal.Y que se anuncie por medio de un edicto que se insertará en el Tablón Edictal Judicial Único (TEJU) .Dese traslado a las partes personadas a los efectos legales oportunos.Dentro de los QUINCE días siguientes a esta puesta de manifiesto del escrito de rendición de cuentas , la parte concursada y las partes personadas podrán formular oposición.Modo de impugnación: recurso de REPOSICIÓN ante el Letrado de la Administración de Justicia, mediante un escrito que se debe presentar en el plazo de CINCO días, contados desde el siguiente al de la notificación, en el que se debe expresar la infracción en que haya incurrido la resolución. Sin estos requisitos no se admitirá la impugnación. La interposición del recurso no tendrá efectos suspensivos respecto de la resolución recurrida (artículos 451 y 452 LEC).Lo acuerdo y firmo.El Letrado de la Administración de JusticiaEn Barcelona, a 10 de octubre de 2023.El Letrado de la Administración de JusticiaBarcelona, 10 de enero de 2024.- El/La Letrado/a de la Administración de Justicia, NOELIA OLTRA HERNANDEZ',
