    'Alicia De La Torre Duñaiturria , la Letrada de la Administración de Justicia del Juzgado de lo Mercantil nº 2 de Girona hago saber que:En el Concurso sin masa 649/2023 se ha dictado auto de conclusión núm. 449/2023 de fecha 20 de diciembre de 2023.Se declara concluso el procedimiento concursal de PANIFICADORA FIGUERENSE, S.L y el archivo de las actuaciones.Acuerdo el cierre provisional de la hoja abierta a la concursada en el Registro mercantil de Girona, a cuyo efecto se expedirá el correspondiente mandamiento. Transcurrido un año a contar desde que se hubiera ordenado por el juez el cierre de la hoja registral sin que se haya producido la reapertura del concurso, el registrador procederá a la cancelación de la inscripción de la persona jurídica, con cierre definitivo de la hoja.Esta resolución será notificada y publicada conforme al art. 482 LC, en la misma forma que se acordó para la declaración de concurso. Y será inscrita en los registros en que se inscribió dicha declaración y comunicada a los órganos judiciales y/o administrativos a los que se ordenó la suspensión de los procedimientos de ejecución contra el patrimonio de la parte concursada, a fin de que, en su caso, los archiven definitivamente. Hágase entrega al Procurador solicitante de los despachos acordados expedir para su curso y gestión.El procurador que reciba el mandamiento deberá presentarlo en el registro público correspondiente ese mismo día o el siguiente hábil, aunque no le hubiera sido facilitada provisión de fondos (art. 556.2 TRLC). Administració de justícia a Catalunya ·Si dentro del plazo de cinco años aparecen nuevos bienes o derechos de la parte concursada, se estará a lo dispuesto en el art. 503 y ss LC.Modo de impugnación: recurso de REPOSICIÓN ante este Órgano judicial, mediante un escrito que se debe presentar en el plazo de CINCO días, contados desde el siguiente al de la notificación, en el que se debe expresar la infracción en que haya incurrido la resoluciónGirona, 10 de enero de 2024.- El/La Letrado/a de la Administración de Justicia, MARTA ORTEGA BALANZA',
