    'El Juzgado de lo Mercantil nº2 de Granada, en cumplimiento de lo dispuesto en los arts. 552. 553 y 554 del Texto Refundido de la Ley Concursal,A N U N C I AQue en el procedimiento de Concurso Voluntario nº161/23, con NIG 1808742120230005581 , se ha dictado auto de fecha 09/01/2024 Auto, en cuya parte dispositiva se contiene literalmente los siguientes extremos:ACUERDO LA CONCLUSIÓN del concurso voluntario de acreedores de la persona física D. JOSE MANUEL BLANCO JERONIMO, con DNI 74735094K,con domicilio en Calle Rambla del Manjón nº 16, 1º, Motril (Granada).inscrito en el Registro Civil y la aprobación de la rendición de cuentas presentada por la administración concursal. De conformidad a ello:Procédase a la publicación de la presente resolución en el BOE, en el Registro Mercantil y en el Registro Público Concursal.Procédase a la cancelación de las anotaciones de declaración de concurso existentes, librando a tal efecto los mandamientos oportunos.Llévese testimonio de la presente resolución a todas las secciones del concurso.Requiérase a la administración concursal para que en el plazo de cinco días desde la cancelación de la inscripción realizada en el Registro mercantil aporte al juzgado su acreditación de administrador cesando en ese momento en sus funciones.Acuerdo la concesión a favor de D. JOSE MANUEL BLANCO JERONIMO, con DNI 74735094K de la exoneración del pasivo insatisfecho en el presente procedimiento concursal, con la extensión prevista en el art. 489.1 TRLC y los efectos establecidos en los arts. 490 a 492 ter TRLC.Por lo que serán exonerables todos los créditos a excepción de los siguientes:1.º Las deudas por responsabilidad civil extracontractual, por muerte o daños personales, así como por indemnizaciones derivadas de accidente de trabajo y enfermedad profesional, cualquiera que sea la fecha de la resolución que los declare.2.º Las deudas por responsabilidad civil derivada de delito.3.º Las deudas por alimentos.4.º Las deudas por salarios correspondientes a los últimos sesenta días de trabajo efectivo realizado antes de la declaración de concurso en cuantía que no supere el triple del salario mínimo interprofesional, así como los que se hubieran devengado durante el procedimiento, siempre que su pago no hubiera sido asumido por el Fondo de Garantía Salarial.5.º Las deudas por créditos de Derecho público. No obstante, las deudas para cuya gestión recaudatoria resulte competente la Agencia Estatal de Administración Tributaria podrán exonerarse hasta el importe máximo de diez mil euros por deudor; para los primeros cinco mil euros de deuda la exoneración será integra, y a partir de esta cifra la exoneración alcanzará el cincuenta por ciento de la deuda hasta el máximo indicado. Asimismo, las deudas por créditos en seguridad social podrán exonerarse por el mismo importe y en las mismas condiciones. El importe exonerado, hasta el citado límite, se aplicará en orden inverso al de prelación legalmente establecido en esta ley y, dentro de cada clase, en función de su antigüedad.6.º Las deudas por multas a que hubiera sido condenado el deudor en procesos penales y por sanciones administrativas muy graves.7.º Las deudas por costas y gastos judiciales derivados de la tramitación de la solicitud de exoneración.8.º Las deudas con garantía real, sean por principal, intereses o cualquier otro concepto debido, dentro del límite del privilegio especial, calculado conforme a lo establecido en esta ley.2. Excepcionalmente, el juez podrá declarar que no son total o parcialmente exonerables deudas no relacionadas en el apartado anterior cuando sea necesario para evitar la insolvencia del acreedor afectado por la extinción del derecho de crédito.3. El crédito público será exonerable en la cuantía establecida en el párrafo segundo del apartado 1.5.º, pero únicamente en la primera exoneración del pasivo insatisfecho, no siendo exonerable importe alguno en las sucesivas exoneraciones que pudiera obtener el mismo deudor.Contra esta resolución, que no es firme, cabe interponer recurso de reposición, en el plazo de 5 días desde su notificación y ante este Juzgado.Así, por este mi Auto, lo acuerdo, mando y firmo, yo, D. ª Josefa García Martín Magistrada-Juez sustituta del Juzgado de lo Mercantil nº 2 de Granada.Granada, 10 de enero de 2024.- El/La Letrado/a de la Administración de Justicia, ALICIA PILAR RAYA GARCIA',
    'E D I C T OEl Juzgado de lo Mercantil nº2 de Granada, en cumplimiento de lo dispuesto en los arts. 552. 553 y 554 del Texto Refundido de la Ley Concursal,A N U N C I A1.- Que en el procedimiento de Concurso Voluntario nº 370/2023, con NIG 1808742120230010273, presentado en fecha 13/04/2023 y repartido a este órgano judicial el día 11/05/2023 por auto de fecha 9/01/2024 se ha declarado en concurso, con el carácterde CONCURSO VOLUNTARIO, al deudor D. JESÚS MARÍA GÓMEZ PÉREZ, con DNI nº 24265230-T , domicilio en C/ Cruz de San Antón, 66 La Zubia (Granada), y cuyo centro de principales intereses lo tiene en dicho domicilio.2.- De acuerdo con la documentación aportada por la deudora concurre el siguiente pasivo:-BANCO SANTANDERSA,Calle Recogidas13.Granada.ndelgadv@gruposantander.es 117.438€-BBVA,PlazadeSanNicolás,número4Bilbaocarlos.ambrosio@bbva.com 69421€-Paloma de Pablos García-Chicano, Acera del Darro 30, 2, 2º B-I,deGranada(desurepresentantelegal)victoriaacosta@abogadosacosta.es 1757,70TOTAL ( euros) 188.616,703.- Por el presente edicto se efectúa llamamiento al acreedor o a los acreedores que representen, al menos, el cinco por ciento del pasivo a fin de que, en el plazo de quince días a contar del siguiente a la publicación del edicto en el suplemento del tablón edictal judicial único del «Boletín Oficial del Estado» y en el Registro público concursal (www.publicidadconcursal.es), puedan solicitar el nombramiento de un administrador concursal para que presente informe razonado y documentado sobre los siguientes extremos:1.º Si existen indicios suficientes de que el deudor hubiera realizado actos perjudiciales para la masa activa que sean rescindibles conforme a lo establecido en esta ley.2.º Si existen indicios suficientes para el ejercicio de la acción social de responsabilidad contra los administradores o liquidadores, de derecho o de hecho, de la persona jurídica concursada, o contra la persona natural designada por la persona jurídica administradora para el ejercicio permanente de las funciones propias del cargo de administrador persona jurídica y contra la persona, cualquiera que sea su denominación, que tenga atribuidas facultades de más alta dirección de la sociedad cuando no exista delegación permanente de facultades del consejo en uno o varios consejeros delegados.3.º Si existen indicios suficientes de que el concurso pudiera ser calificado de culpable.4. Se advierte al acreedor o acreedores que representen, al menos, el cinco por ciento del pasivo y que, dentro de plazo, formulen solicitud de nombramiento de administrador concursal para que emita el informe a que se refiere el artículo 37 ter, que la retribución del administrador nombrado por la emisión del informe encomendado, corresponderá al acreedor o acreedores que lo hubieran solicitado, (art. 37 quater).5. En el caso de que, dentro de plazo, ningún legitimado hubiera formulado esa solicitud, el deudor que fuera persona natural podrá presentar solicitud de exoneración del pasivo insatisfecho.Granada, 10 de enero de 2024.- El/La Letrado/a de la Administración de Justicia, ALICIA PILAR RAYA GARCIA',
