    'E D I C T OEL JUZGADO DE LO MERCANTIL Nº 2 DE GRANADA, DE MARCAS, PATENTES Y PROTECCIÓN JURÍDICA DEL DISEÑO INDUSTRIALQue en la Sección 5ª del procedimiento concursal número 549/2022 , con NIG nº 1808742120220023761 , que se tramita en este Juzgado respecto de la concursada RUFINA ORTEGA GAMARRA titular del NIF nº 24161273A, se ha dictado auto aprobando el plan de liquidación de los bienes y derechos de la concursada, cuya parte dispositiva es del tenor literal siguiente:PARTE DISPOSITIVA1.- SE APRUEBA el Plan de Liquidación propuesto por el deudor.En el momento de la enajenación quedarán canceladas todas las cargas anteriores al concurso constituidas a favor de créditos concursales que no gocen de privilegio especial conforme al artículo 270 TRLC (art. 90 LC).La cancelación de las cargas constituidas a favor de créditos concursales que gocen de privilegio especial, requerirá el abono del precio, salvo en el caso de que la adquisición del bien se produzca por quien ostente la garantía real que lo grava, por cuanto la misma quedará extinguida por confusión.Respecto de las segundas y ulteriores garantías regirá lo dispuesto en el artículo 674 de la Ley de Enjuiciamiento Civil.2.- REQUIERO a la administración concursal para que en el plazo de TRES MESES informe del estado de la liquidación o antes si se hubiera procedido a la enajenación de todos los bienes.3.- ACUERDO la apertura de la sección de calificación, que se encabezará con testimonio de esta resolución judicial y que incorporará testimonios de la solicitud de declaración de concurso, la documentación aportada por el deudor, el auto de declaración de concurso y el informe de la administración.4.- ACUERDO que la administración concursal presente copia testimoniada de este auto, de la diligencia de firmeza de la misma y del plan de liquidación en los Registros Públicos en los que haya de procederse a la inscripción de las enajenaciones que se practiquen con arreglo al plan, en el momento de interesarse la misma.5- PUBLICIDAD:a) Se acuerda la publicación del edicto de aprobación del plan en el tablón de anuncios de este Tribunal y en el Registro Público Concursal (art. 554 TRLC)b) Podrá darse al plan de liquidación y la publicidad sin costes que se estime procedente por la concursada y por la administración concursal, especialmente en webs de colegios/asociaciones públicas relacionadas con la realización de bienes/derechosFórmese la Sección Sexta de calificación del concurso, que se encabezara con testimonio de la presente resolución a que se añadirán los documentos señalados en el art. 446 TRLC (art. 167.1 LC.) Conforme a la DT 1.3 7ª de la Ley 16/2022 por la que se modifica el Texto Refundido de la Ley Concursal, el régimen de calificación aplicable se regirá por el texto reformado, no obstante, procede conceder a los acreedores o persona que acredite interés legítimo el plazo de diez días siguientes a la última publicación de esta resolución, para poder personarse y ser parte en la sección alegando por escrito cuanto considere relevante para la calificación del concurso como culpable.Conforme al art. 449 TRLC, dentro de los diez días siguientes al de la remisión del informe de calificación del administrador concursal., los acreedores que hubieran formulado alegaciones para la calificación del concurso como culpable, siempre que representen, al menos, el cinco por ciento del pasivo o sean titulares de créditos por importe superior a un millón de euros según la lista provisional presentada por la administración concursal, podrán presentar también un informe razonado y documentado sobre los hechos relevantes para la calificación del concurso como culpable.Notifíquese a las partes personadas y a la Administración Concursal, haciéndoles saber que contra esta resolución, que no es firme, cabe interponer recurso de apelación, en el plazo de 20 días desde su notificación, ante este Juzgado para su conocimiento por parte de la Audiencia Provincial de Granada.Así, por este mi Auto, lo acuerdo, mando y firmo, yo, D.ª Josefa García Martín, Magistrada-Juez Sustituta del Juzgado de lo Mercantil nº 2 de Granada.Granada, 10 de enero de 2024.- El/La Letrado/a de la Administración de Justicia, ALICIA PILAR RAYA GARCIA',
