    'EDICTODª. María Eugenia López-Jacoiste Rico, Letrada de la Administración de Justicia y del Juzgado de lo Mercantil 15 de Madrid, hace saber:ANUNCIA1º Que en el procedimiento Concurso Abreviado 219/23 con Número de Identificación General del procedimiento 28.079.00.2-2023/0155004, por auto de fecha 09/01/2024, se ha declarado la conclusión del concurso de la mercantil RENTALITAS, S.L., con CIF B-85515492 y domiciliado en Paseo de la Castellana, Nº 177-D, 7º, CP: 28046 de Madrid.2º Cesan las limitaciones de las facultades de administración y disposición del deudor subsistentes, salvo las que se contengan en la sentencia firme de calificación en su caso.3º Tratándose en este caso de una persona jurídica procede declarar su extinción.Madrid, 10 de enero de 2024.- El/La Letrado/a de la Administración de Justicia, MARIA EUGENIA LOPEZ-JACOISTE RICO',
    'EDICTODOÑA ROCIO PERALES BELIZON LETRADA DE LA ADMINISTRACIÓN DE JUSTICIA DE LOS JUZGADOS DE LO MERCANTIL Nº 5 DE MADRID.ANUNCIA1º Que en el procedimiento Concurso consecutivo 234/2022 referente al deudor RESTAMADFOOD, S.L.U. por auto de fecha 08/01/2024 se ha decretado la conclusión y archivo del concurso por insuficiencia de la masa activa para la satisfacción de los créditos contra la masa.2º Cesan las limitaciones de las facultades de administración y disposición del deudor subsistentes, salvo las que se contengan en la sentencia firme de calificación en su caso.3º Tratándose en este caso de una persona jurídica, procede conforme a lo ordenado en el TRLC declarar su extinción.Madrid, 10 de enero de 2024.- El/La Letrado/a de la Administración de Justicia, ROCIO PERALES BELIZON',
    'E D I C T ODña. María Eugenia López –Jacoiste Rico, Letrada de la Administración de Justicia y del Juzgado de lo Mercantil nº 15 de MadridANUNCIAQue en el concurso de la mercantil. YDROLIA INGENIERIA Y SERVICIOS S.L., por resolución de fecha 08/01/2024 se ha acordado:1. Remitir el informe por el letrado de la Administración de Justicia por medios electrónicos junto con los documentos anejos al Registro público concursal.2. La administración concursal remitirá el informe y los documentos anejos por correo electrónico al deudor, a aquellos que hubiesen comunicado sus créditos de cuya dirección electrónica tenga constancia, estén o no incluidos en la lista de acreedores, y a quienes, aunque no fueran acreedores, estuvieran personados en el concurso. (Art. 294 TRLC).3. Dentro del plazo de diez días las partes personadas en el concurso de acreedores podrán impugnar el inventario y la lista de acreedores. El plazo contará desde la inserción de esos documentos en el Registro público concursal. (Art 297 TRLC)La impugnación del inventario podrá consistir en la solicitud de la inclusión o de la exclusión de bienes o derechos, o del aumento o disminución del avalúo de los incluidos y la impugnación de la lista de acreedores podrá referirse a la inclusión o a la exclusión de créditos concursales, así como a la cuantía o a la clasificación de los reconocidos.4. Dentro del plazo de quince días, la administración concursal presentará un informe razonado y documentado sobre los hechos relevantes para la calificación del concurso, con propuesta de resolución, uniendo, en su caso, las alegaciones de calificación culpable recibidas como anejo al informe. (Art. 448)*Todos los plazos anteriores contarán desde la publicación del informe en el Registro público concursal.Madrid, 10 de enero de 2024.- El/La Letrado/a de la Administración de Justicia, MARIA EUGENIA LOPEZ-JACOISTE RICO',
    'EDICTOEl Juzgado de lo Mercantil nº 05 de Madrid, anuncia:En el procedimiento concurso consecutivo 284/2022 se ha dictado en fecha 08/01/24 auto por el que se acuerda la CONCLUSION del concurso de D. JORGE GONZÁLEZ NOGALES, con DNI 53****52S y Dª. LINA VANESSA ORTEGA MEDINA con N.I.E. X4****78M cesando todos los efectos de la declaración del concurso.Cese en su cargo el administrador concursal, aprobándose las cuentas formuladas.Se reconoce a D. JORGE GONZÁLEZ NOGALES y Dª. LINA VANESSA ORTEGA MEDINA el beneficio de exoneración del pasivo insatisfecho con carácter definitivo, y por ello se declara la exoneración de la totalidad de las deudas insatisfechas, sin más pronunciamientos, conforme fundamento de derecho de auto de conclusión.El pasivo no satisfecho exonerado se debe considerar extinguido, sin perjuicio del régimen de revocación previsto en el art. 492 TRLC.La extinción de los créditos no alcanza a los obligados solidarios, fiadores y avalistas del concursado respecto de los créditos que se extinguen.Contra la exoneración del pasivo insatisfecho cabe interponer recurso de reposiciónen el plazo de cinco días.Madrid, 10 de enero de 2024.- El/La Letrado/a de la Administración de Justicia, ROCIO PERALES BELIZON',
