    'EL JUZGADO DE LO MERCANTIL Nº 4 DE MADRIDANUNCIA:En este Juzgado se sigue procedimiento especial de microempresas nº 380/2023 de la mercantil CORRIENDO VOY S.L. con CIF B86707817 en el que en fecha 1 dediciembre de 2023 se ha dictado auto con los siguientes pronunciamientos:1.- CONCLUIR el procedimiento especial de microempresas de la mercantil CORRIENDO VOY S.L. CIF B86707817 POR INSUFICIENCIA DE MASA ACTIVA, cesando todos los efectos de la apertura del procedimiento, sin perjuicio de su posible reapertura.2. La extinción de la personalidad jurídica de la sociedad instante y el cierre provisional de la hoja registral que tenga abierta en el Registro Público en el que figure inscrita.3. Transcurrido un año a partir de esta resolución sin que se haya ordenado la reaperturadel concurso, procédase por el registrador a la cancelación de la inscripción de la persona jurídica, con cierre definitivo de la hoja.4. Notifíquese esta resolución a la concursada y a todas las partes personadas en elprocedimiento.5. Publíquese en el Registro Público Concursal y, por medio de edicto, en el «BoletínOficial del Estado» (art. 482 TRLC).6. Líbrese mandamiento por duplicado al Registro Mercantil para que proceda a la cancelación de la inscripción de los asientos correspondientes a la declaración del concurso y la hoja registral de la sociedad. Asimismo, el Registrador Mercantil deberá comunicar al resto de registros públicos en los que la concursada tenga inscritos bienes y derechos, la presente conclusión a los efectos oportunos.7. Insértese testimonio de esta resolución en los autos principales y llévese el original alLibro correspondiente.Procédase al archivo de las actuaciones.Contra esta resolución no cabe recurso alguno.Madrid, 10 de enero de 2024.- El/La Letrado/a de la Administración de Justicia, MARIA JESUS RODRIGUEZ FERNANDEZ',
