    'EdictoEl Juzgado de lo Mercantil n.º 1 de MálagaanunciaQue en el procedimiento concursal nº 224/2012 referente al concursado PROYECTOS Y OBRAS PRODESU S.L., con CIF B92690627 , se ha dictado auto de fecha 19/12/2023 acordando la conclusión del concurso por insuficiencia de masa activa, cesando las limitaciones de las facultades de administración y disposición del deudor subsistentes en ese momento. Se acuerda asimismo el cese de la administración concursal, la aprobación de la rendición de cuentas presentada por la administración concursal y la extinción de la sociedad. Contra esta resolución no cabe recurso alguno.Málaga, 10 de enero de 2024.- El/La Letrado/a de la Administración de Justicia, DAVINIA JIMENEZ CHAMIZO',
    'Edictoanuncia1.- Que en el procedimiento nº 247/2023 con NIG 2906742120230016097, por auto de fecha 26 de diciembre de 2023 se ha declarado en situación de concurso voluntario sin masa al deudor Dña. ANTONIA MARIA VALLEJO ESTEBAN, con DNI 33396451Z cuyo centro de principales intereses lo tiene en Málaga, todo ello en base a la solicitud presentada el 13/07/2023 y con fecha de reparto a este Juzgado el 15/09/23. El pasivo asciende a la cantidad de 103.368,04 euros.2.- Que en el mismo auto de declaración del concurso, se hace llamamiento a los acreedores que representen, al menos, el cinco por ciento del pasivo a fin de que, en el plazo de QUINCE DÍAS a contar del siguiente a la publicación del edicto, soliciten el nombramiento de un administrador concursal para que presente informe razonado y documentado sobre los extremos enumerados en el artículo 37 ter del TRLC consistentes en:1.º Si existen indicios suficientes de que el deudor hubiera realizado actos perjudiciales para la masa activa que sean rescindibles conforme a lo establecido en esta ley.2.º Si existen indicios suficientes para el ejercicio de la acción social de responsabilidad contra los administradores o liquidadores, de derecho o de hecho, de la persona jurídica concursada, o contra la persona natural designada por la persona jurídica administradora para el ejercicio permanente de las funciones propias del cargo de administrador persona jurídica y contra la persona, cualquiera que sea su denominación, que tenga atribuidas facultades de más alta dirección de la sociedad cuando no exista delegación permanente de facultades del consejo en uno o varios consejeros delegados.3.º Si existen indicios suficientes de que el concurso pudiera ser calificado de culpable.Se advierte a los acreedores que, de acuerdo con el art. 37 quater .1 del TRLC, la satisfacción de los honorarios del administrador nombrado para realizar el informe mencionado corresponderá al acreedor o acreedores que lo hubieran solicitado.3.- Se acuerda la publicación dela declaración de concurso en el Boletín Oficial del Estado en el suplemento del tablón judicial edictal único, y en el Registro Público Concursal, remitiéndose a tal efecto un edicto que contendrá las menciones indispensables que establece el artículo 35 del TRLC, teniendo en cuenta lo previsto en el artículo 552 del TRLC para las publicaciones telemáticas.4- Que los acreedores, a los efectos del llamamiento recogido en el punto número 2, deberán comparecer por medio de procurador y asistidos de letrado (artículo 512 del Texto Refundido de la Ley Concursal)5.- Que se designa la página web https://www.publicidadconcursal.es/ a los efectos de publicidad registral en el Registro Público Concursal.Málaga, 10 de enero de 2024.- El/La Letrado/a de la Administración de Justicia, DAVINIA JIMENEZ CHAMIZO',
    'Acuerdo la conclusión del presente procedimiento de concurso de acreedores de INVRSIONES M4RTER ANDALUCIA SL por haber concluido las operaciones de liquidación y por insuficiencia de masa activa para el pago de todos los créditos contra la masa, cesando las limitaciones de las facultades de administración y disposición del deudor subsistentes en este momento y cesando en su cargo el administrador.Se acuerda la extinción de la sociedad debiendo procederse a su cancelación en los registros públicos y en el Registro Mercantil de Málaga, para lo cual se librará el correspondiente mandamiento con el testimonio de esta resolución.Aprobar la rendición de cuentas presentada por la administración concursal.Contra esta resolución no cabe recurso alguno.Málaga, 10 de enero de 2024.- El/La Letrado/a de la Administración de Justicia, DAVINIA JIMENEZ CHAMIZO',
    'EdictoJuzgado de lo Mercantil nº 1 de MálagaAnunciaQue en el procedimiento concursal nº 947/2009 referente al concursado Aifos Arquitectura y Promociones Inmobiliarias S.A. (C.I.F.A-29403052) se ha acordado a solicitud de la administración concursal la publicación del presente edicto en el tablón edictal judicial único del BOE y en el Registro Público Concursal por término de diez (10) días hábiles, para que los interesados puedan presentar ofertas, pudiendo revisar los términos de la oferta y las condiciones y plazo para hacer una posible mejora en la página web de la administración concursal que es www.administradorconcursalaifos.com, y deberán dirigir las posibles mejoras directamente a la administración concursal, al correo electrónico consultas@administradorconcursalaifos.com; y para mayor información y detalle acerca del activo objeto de la presente oferta, se informa a los posibles interesados que pueden contactar con la administración concursal en el teléfono 952 34 54 00 o remitir email a la referida dirección de correo electrónico consultas@administradorconcursalaifos.comSe inserta a continuación los datos de la oferta recibida por la administración concursal a mejorar y los activos objeto de la misma:Objeto de la oferta:Plaza de aparcamiento, perteneciente a la Urbanización “Balcones de Roquetas”, en AvenidaCiudad de Córdoba en Planta -1, señalada con el número 79, situada en la localidad deRoquetas de Mar (Almería).Se corresponde con la finca registral número 76.196 inscrita en el Registro de la Propiedadnº1 de Roquetas de Mar e identificada con la referencia catastral 3756302WF3635N0080ZA.Importe de la oferta:El importe de la oferta asciende a TRES MIL EUROS (3.000,00 €), IVA no incluidos.En el precio de la venta se encuentran incluidos los siguientes gastos:● IBIS devengados y pendientes de pago desde la fecha de declaración de concurso.● Cuotas de comunidad de propietarios devengadas y pendientes de pago desde la fecha de declaración de concurso.● Impuesto sobre el Incremento del Valor de los Terrenos de Naturaleza Urbana(IIVTNU), (Plusvalía), en el caso de que procediera según la normativa aplicable.Términos adicionales:El importe de la venta se verá incrementado con los siguientes gastos asumidos, adicionalmente, por la parte compradora:Los gastos notariales, registrales, impuestos y tributos a los que diere lugar el otorgamiento de las escrituras públicas de compraventa.Los gastos derivados de la cancelación cualesquiera cargas que consten inscritas en el Registro de la Propiedad.La oferta, además, va acompañada de una caución correspondiente al 10% del importe, en señal de garantía de la oferta.ArrendamientoActualmente el aparcamiento no se encuentra arrendado.Para más información consultar el Registro Público Concursal "https:\\www.publicidadconcursal.es"Málaga, 10 de enero de 2024.- El/La Letrado/a de la Administración de Justicia, DAVINIA JIMENEZ CHAMIZO',
