    'EDICTOLetrada de la Administración de Justicia: D.ª Juana Galvez MuñozEn cumplimiento de lo dispuesto en el artículo 35 y 37 bis del texto refundido de la Ley Concursal, aprobado por Real Decreto Legislativo 1/2020 anuncia:Que en el procedimiento número 616/2023 negociado 8, NIG n.º 4109142120230063985, por auto de 21/12/23 se ha declarado en concurso sin masa al deudor D. Francisco Javier Rodríguez Herruzo, cuya parte dispositiva dice literalmente lo siguientes:PARTE DISPOSITIVA1.- Declaro en concurso a FRANCISCO JAVIER RODRÍGUEZ HERRUZO con DNI: 14615220P.2.- El pasivo del concurso asciende a 376.213,44 euros3.- Ordeno la remisión telemática al Boletín Oficial del Estado para su publicación en el suplemento del tablón edictal judicial único y la publicación en el Registro público concursal.4.- En el plazo de QUINCE DÍAS a contar del siguiente a la publicación de dicho edicto, el acreedor o los acreedores que representen, al menos, el cinco por ciento del pasivo indicado en el punto 2, pueden solicitar por escrito ante este juzgado, el nombramiento de un administrador concursal para que presente informe razonado y documentado sobre los extremos previstos en el apartado primero del artículo 37 ter del Texto Refundido de la Ley Concursal.5.- Notifíquese esta resolución a la parte solicitante, a la Agencia Estatal de Administración Tributaria, a la Tesorería General de la Seguridad Social, a las partes personadas y, en su caso, a la representación legal de las personas trabajadoras, haciéndoles saber que contra la misma cabe recurso de REPOSICIÓN ante este Juzgado, no obstante lo cual, se llevará a efecto lo acordado. El recurso deberá interponerse por escrito en el plazo de CINCO DÍAS hábiles (contados, para el deudor, desde el siguiente de la notificación, y para los demás legitimados, desde la publicación del extracto de la declaración de concurso en el Boletín Oficial del Estado) y expresando la infracción cometida a juicio del recurrente, sin cuyos requisitos no se admitirá a trámite el recurso (artículos 545 y 546 del Texto Refundido de la Ley Concursal y 451 y 452 Ley de Enjuiciamiento Civil).Para la admisión del recurso previamente deberá efectuarse constitución de depósito en cuantía de 25 euros, debiendo ingresarlo en la cuenta de este Juzgado nº 2233 0000 00 seguida de cuatro dígitos (que se corresponden con el número del procedimiento, añadiendo a la izquierda tantos ceros como falten) y de otros dos dígitos (que se corresponden con el año del procedimiento) indicando en las Observaciones del documento de ingreso que se trata de un recurso seguido del código 00 y tipo concreto del recurso, de conformidad con lo establecido en la L.O 1/2009 de 3 de noviembre, salvo concurrencia de los supuestos de exclusión previstos en el apartado 5º de la Disposición adicional decimoquinta de dicha norma o beneficiarios de asistencia jurídica gratuita.Así lo acuerda, manda y firma S.Sª, don Francisco Javier Carretero Espinosa de los Monteros, Magistrado de la Sección Primera del Tribunal de Instancia Mercantil de Sevilla. Doy fe.EL MAGISTRADO LA LETRADA DE LA ADM. DE JUSTICIAEn Sevilla, en el día de la firma.LA LETRADA DE LA ADMINISTRACIÓN DE JUSTICIALa difusión del texto de esta resolución a partes no interesadas en el proceso en el que ha sido dictada solo podrá llevarse a cabo previa disociación de los datos de carácter personal que el mismo contuviera y con pleno respeto al derecho a la intimidad, a los derechos de las personas que requieran un especial deber de tutela o a la garantía del anonimato de las víctimas o perjudicados, cuando proceda.Los datos personales incluidos en esta resolución no podrán ser cedidos, ni comunicados con fines contrarios a las leyes.Sevilla, 10 de enero de 2024.- El/La Letrado/a de la Administración de Justicia, JUANA GALVEZ MUÑOZ',
