    'EDICTOLetrada de la Administración de Justicia: D.ª Juana Galvez MuñozEn cumplimiento de lo dispuesto en el artículo 35 del texto refundido de la Ley Concursal, aprobado por Real Decreto Legislativo 1/2020 anuncia:1.º- Que en el procedimiento de concurso ordinario número 754/2023-5, NIG n.º 4109142120230068929, por auto de fecha 11 de diciembre de 2023, se ha declarado en concurso voluntario ordinario al deudor D. José Antonio Gómez Hidalgo, con DNI nº 30227246W y domicilio en Avenida Dos Hermanas, número 23 , piso 1 puerta w; CP: 41500, de Alcalá de Guadaira (Sevilla)2º.- Que el concurso tiene la consideración de voluntario y se tramitará por lo prevenido en los art. 1 a 566 TRLC, tras la reforma operada por la Ley 16/2022.3º.- Que el deudor conserva las facultades de administración y de disposición de su patrimonio, pero sometidas éstas a la intervención de la administración concursal.4º- Que los acreedores del concursado deberán dirigir a la administración concursal la existencia de sus créditos en la forma y con los datos expresados en el art 255 y ss. del Texto Refundido de la Ley Concursal.A estos efectos se informa que la administración concursal designada ha sido D. Pedro López López, con DNI nº 27304637A y con domicilio profesional en Av. República Argentina, nº 18, Entre- planta A, 41011 Sevilla; teléfono de contacto 954.656.469 y fax 954.654.619.El plazo para esta comunicación es el de UN MES a contar desde el día siguiente a la publicación en el Boletín Oficial del Estado.5º- Que los acreedores e interesados que deseen comparecer en el procedimiento deberán hacerlo por medio de Procurador y asistidos de Letrado.6º.- Que las resoluciones que traigan causa del presente procedimiento se publicarán en el registro público concursal, en la siguiente dirección electrónica: https://www.publicidadconcursal.es/concursal-web/afectado/buscar.7º.- Asimismo, se hace constar que por el deudor se ha presentado petición de exoneración de pasivo insatisfecho con sujeción a plan de pagos y, de conformidad con lo dispuesto en el Art. 498.1 del TRLC, se confiere traslado de la propuesta de plan de pagos presentada a todos los acreedores interesados a fin de que, dentro del plazo de 10 días, puedan alegar cuanto estimen oportuno en relación con la concurrencia de los presupuestos y requisitos legales para la exoneración o con la propuesta de plan de pagos presentada. Los acreedores personados podrán proponer el establecimiento de medidas limitativas o prohibitivas de los derechos de disposición o administración del deudor, durante el plan de pagos. Dicho plazo se computará desde la publicación en el Teju.En Sevilla, en el día de la firma.LA LETRADA DE LA ADMINISTRACIÓN DE JUSTICIASevilla, 10 de enero de 2024.- El/La Letrado/a de la Administración de Justicia, JUANA GALVEZ MUÑOZ',
