    'D./Dª. PILAR IRLES MARTÍNEZ, Letrado A. Justicia del Juzgado de lo Mercantil num. 5 de VALENCIA, por el presente HAGO SABER:Que en este Juzgado se tramitan autos de Concurso de Acreedores CONCURSO ABREVIADO [CNA] núm. 000749/2023 habiéndose dictado en fecha 8/01/24 por el Ilmo/a. Sr/a. Magistrado-Juez Auto por el que se acuerda: 1.-Reconocer la EXONERACIÓN DEL PASIVO INSATISFECHO a D./DªCRISTINA GARCIA BLASCO. La exoneración es definitiva alcanzado la misma a la totalidad de los créditos, tanto comunicados como no comunicados, siempre que no tengan la condición legal de no exonerables de conformidad con lo dispuesto en el fundamento jurídico SEGUNDO de la presente resolución.No queda exonerado el crédito de 334,44 euros cuya titularidad corresponde al Ayuntamiento de Valencia.El pasivo no satisfecho EXONERADO se debe considerar inexigible, sin perjuicio del régimen de revocación previsto en el art. 493 TRLC. La extinción de los créditos no alcanza a los obligados solidarios, fiadores y avalistas del concursado respecto de los créditos que se exoneran.2.-La CONCLUSION del concurso de D./DªCRISTINA GARCIA BLASCO, cesando respecto del mismo todos los efectos de la declaración del concurso, una vez sea firme la resolución que lo acuerda.Con la presente publicación se da la publicidad establecida en el art. 482 del TRLC para la resolución que acuerda la conclusión del procedimiento. Más información disponible en el Registro Público Concursal a través del enlace:https://www.publicidadconcursal.es/consulta-publicidad-concursal-newEn VALENCIA, a ocho de enero de dos mil veinticuatro.EL/LA LETRADO/A A. JUSTICIAValència, 10 de enero de 2024.- El/La Letrado/a de la Administración de Justicia, PILAR IRLES MARTINEZ ',
    'En fecha 20/12/23 se ha dictado auto de conclusión con fines estadísticos a fin dedar cumplimiento a la Sentencia de fecha 09/11/23 dictada en el incidente concursal nº630/2023, dimanante de los autos de concurso nº 760/2022, y cuyo fallo tiene elsiguiente tenor literal:"Procede la ESTIMACIÓN de la demanda incidental interpuesta por la TESORERIA GENERAL DE LA SEGURIDAD SOCIAL, frente a D. ANTONIO BONALES LOPEZ y se declara que respecto a lasdeudas mantenidascon la demandante no son exonerables en el importe de 7.749,62 €, declarando la subsistencia y su carácter no exonerable, siendo que la tramitación de las solicitudes de aplazamiento o fraccionamiento de los créditos, en su caso, se regirán por su normativa específica, presentando la solicitud ante la administración pública correspondiente.Acuerdo la conclusión del concurso de D. Antonio Bonales López, con los efectos generales y particulares de los artículos 483 y 484 TRLC.Concedo al concursado la exoneración del pasivo insatisfecho, en la extensión prevista en el artículo 489 TRLC y con los efectos establecidos en los artículos 490 y ss TRLC.Conforme al art. 556 TRLC, los mandamientos y documentación necesaria para la práctica de los asientos, se remitirán por el Juzgado por vía telemática a los registros públicos, pero en caso de resultar imposible, se entregarán al procurador de la concursada para su inmediata presentación.MODO DE IMPUGNACIÓN: mediante recurso de APELACIÓN ante la Audiencia Provincial de VALENCIA (artículo 455 LEC).El recurso de apelación se interpondrá ante el tribunal que haya dictado la resolución que se impugne dentro del plazo de VEINTE DÍAS contados desde el día siguiente a la notificación de aquélla (artículo 458 LEC)Así por esta sentencia, lo pronuncio, mando y firmo."URL Registro Público Concursal https://www.publicidadconcursal.es/València, 10 de enero de 2024.- El/La Letrado/a de la Administración de Justicia, JOSE VICTOR SANZ GORDON',
