    'EDICTO Rafael Huerta García , el Letrado de la Administración de Justicia del Juzgado de lo Mercantil nº 07 de Barcelona al objeto de dar publicidad al auto de declaración de concurso dictado por este órgano judicial, hago saber:Número de asunto.Concurso sin masa 258/2023Sección: /NIG: 0801947120238001796Fecha de presentación de la solicitud: 10/02/2023Fecha del auto de declaración. 24/11/2023.Clase de concurso. VOLUNTARIO.Entidad concursada. Cristina Enfedaque Virott, con 36567202P.Llamamiento a los acreedores. Llamamiento al acreedor o a los acreedores que representen, al menos, el cinco por ciento del pasivo a fin de que, en el plazo de quince días a contar del siguiente a la publicación del edicto, puedan solicitar el nombramiento de un administrador concursal para que presente informe razonado y documentado sobre los siguientes extremos:1.º Si existen indicios suficientes de que el deudor hubiera realizado actos perjudiciales para la masa activa que sean rescindibles conforme a lo establecido en esta ley.2.º Si existen indicios suficientes para el ejercicio de la acción social de responsabilidad contra los administradores o liquidadores, de derecho o de hecho, de la persona jurídica concursada, o contra la persona natural designada por la persona jurídica administradora para el ejercicio permanente de las funciones propias del cargo de administrador persona jurídica y contra la persona, cualquiera que sea su denominación, que tenga atribuidas facultades de más alta dirección de la sociedad cuando no exista delegación permanente de facultades del consejo en uno o varios consejeros delegados.3.º Si existen indicios suficientes de que el concurso pudiera ser calificado de culpable.En el caso de que, dentro de plazo, acreedor o acreedores que representen, al menos, el cinco por ciento del pasivo formularan solicitud de nombramiento de administrador concursal para que emita el informe, el juez, mediante auto, procederá al nombramiento para que, en el plazo de un mes a contar desde la aceptación, emita el informe solicitado.En el mismo auto fijará la retribución del administrador por la emisión del informe encomendado, cuya satisfacción corresponderá al acreedor o acreedores que lo hubieran solicitado. En el caso de que, dentro de plazo, ningún legitimado hubiera formulado esa solicitud, el deudor que fuera persona natural podrá presentar solicitud de exoneración del pasivo insatisfecho en los términos del art. 501 del TRLC.En Barcelona, a 24 de noviembre de 2023Barcelona, 10 de enero de 2024.- El/La Letrado/a de la Administración de Justicia, RAFAEL HUERTA GARCIA',
