    'EDICTOD./Dña. MARÍA JESÚS RODRÍGUEZ FERNÁNDEZ, Letrado/a de laAdministración de Justicia del Juzgado de lo Mercantil nº 04 de Madrid hace saber:1.- Que en el concurso Concurso ordinario 556/2023, con Número deIdentificación General del procedimiento 28.079.00.2-2023/0417225, por auto de fecha08.01.2023, se ha declarado en concurso voluntario, , a D./Dña. MARIA NATIVIDADOROZCO MARTIN VENTURA GALAN y D./Dña. ADRIAN CABAÑASGARRANCHO, con nº de identificación 50025997P y 01894010Y, y domiciliado enCALLE: COMUNIDAD ECONOMICA EUROPEA, nº 8 Esc/Piso/Prta: PBJ A SanMartín de la Vega (Madrid) y CALLE: COMUNIDAD ECONOMICA EUROPEA, nº8 Esc/Piso/Prta: PBJ A San Martín de la Vega (Madrid) , cuya parte dispositiva es lasiguiente:PARTE DISPOSITIVA1.- DECLARAR CONJUNTAMENTE EN CONCURSO VOLUNTARIO deacreedores D. ADRIAN CABAÑAS GARRANCHO con NIF 5002599P y D./Dña.MARIA NATIVIDAD OROZCO MARTIN VENTURA GALAN con NIF 01894010Y,con domicilio C\Comunidad Económica Europea nº8 - 28330 San Martín de la Vega(Madrid).Los concursos se tramitarán de forma coordinada.2.- Efectos del concurso sobre las facultades patrimoniales del deudor.Conforme al art. 413.1 TRLC:1.Si el concursado fuera persona natural la apertura de la fase de liquidaciónproducirá los siguientes efectos:La autenticidad de este documento se puede comprobar en www.madrid.org/covemediante el siguiente código seguro de verificación: 0982737008130175356729Juzgado de lo Mercantil nº 04 de Madrid - Concurso ordinario 556/2023 2 de 31º. La suspensión del ejercicio de las facultades de administración y de disposiciónsobre los bienes y derechos que integran la masa activa, con todos los efectosestablecidos para la suspensión en el título III del libro primero.2º. La extinción del derecho a alimentos con cargo a la masa activa, salvo cuando fuereimprescindible para atender a las necesidades mínimas del concursado, cónyuge opareja de hecho inscrita, descendientes bajo su potestad y ascendientes a su cargo.3º. El derecho a solicitar la exoneración del pasivo insatisfecho, si concurren lospresupuestos y requisitos establecidos en esta ley.El ámbito de la suspensión estará limitado a los bienes y derechos integrados o que seintegren en la masa activa, a la asunción, modificación o extinción de obligaciones decarácter patrimonial relacionadas con esos bienes o derechos (art. 107.1 TRLC).La infracción del régimen de limitación de facultades tendrá las consecuencias previstasen el art. 109 TRLC.3.- Nombrar ADMINISTRADORA CONCURSAL a D. JOSÉ TOMÁS MIÑANABELTRÁN, Abogado .La AC intervendrá el ejercicio de las facultades de administración y disposición sobre lamasa activa del deudor, pudiendo autorizar o denegar la autorización según tenga porconveniente.4. La AC realizará las comunicaciones a acreedores, organismos públicos yrepresentantes de los trabajadores previstas en los artículos 252 a 254 TRLC.5.- Llamamiento a los acreedores. En el plazo de un mes a contar desde el díasiguiente a la publicación de la declaración de concurso en el «Boletín Oficial delEstado», los acreedores pondrán en conocimiento de la administración concursal laexistencia de sus créditos.La comunicación se hará conforme a lo previsto en los artículos 255 a 258 TRLC:6.- Publicidad de esta resolución. Esta resolución se publicará en el Boletín Oficialdel Estado y en el Registro Público Concursal.El mismo día de la aceptación del cargo por el administrador concursal, el letrado de laAdministración de Justicia remitirá por medios electrónicos al "Boletín Oficial delEstado", para su publicación en el suplemento del tablón judicial edictal único, y alRegistro público concursal el edicto relativo a la declaración de concurso, redactado enel modelo oficial para que sea publicado con la mayor urgencia. La publicación deledicto tendrá carácter gratuito (art. 35.1 TRLC).7.- Notificaciones. La Letrada de la Administración de Justicia notificará este auto alDEUDOR, a la AGENCIA ESTATAL DE LA ADMINISTRACIÓN TRIBUTARIA y ala TESORERIA GENERAL DE LA SEGURIDAD SOCIAL (art. 33 TRLC), y alFONDO DE GARANTIA SALARIAL a los efectos del art. 514 TRLC.La autenticidad de este documento se puede comprobar en www.madrid.org/covemediante el siguiente código seguro de verificación: 0982737008130175356729Juzgado de lo Mercantil nº 04 de Madrid - Concurso ordinario 556/2023 3 de 3Si el deudor fuera empleador, este auto también se notificará a losREPRESENTANTES LEGALES DE LOS TRABAJADORES aún en los supuestos enlos que no se hubiese personado o no hubiera comparecido como parte en elprocedimiento (artículo 37 ter.3 del TRLC).8.- Anotación e inscripción en los registros públicos. De conformidad con losartículos 36 y 37 TRLC:(i). - Líbrense mandamientos por duplicado a los Registros de la Propiedad dondeconsten inscritos los bienes de la persona concursada, para la anotación preventiva, yuna vez firme el auto la inscripción, de la declaración de concurso, así como acualesquiera otros Registros Públicos donde pudieran constar inscritos bienes y/oderechos de la persona concursada.(ii). - Líbrese mandamiento por duplicado al Registro Civil.Madrid, a ocho de enero de dos mil veinticuatro.EL/LA LETRADO DE LA ADMINISTRACIÓN DE JUSTICIAMadrid, 10 de enero de 2024.- El/La Letrado/a de la Administración de Justicia, MARIA JESUS RODRIGUEZ FERNANDE',
