    'AUTOD./Dña. FELIPE MAZA ORTIZEn Huércal-Overa, a cuatro de noviembre de dos mil veintidósPor presentado el anterior escrito con la copia de poder, documentos y copias acompañados. Se tiene por parte al/la Procurador/a D/Dª MARIA MERCEDES VILLENA TOUS, en la representación que acredita de BANKINTER SAANTECEDENTES DE HECHOÚNICO.- Por el /la Procurador/a expresado/a en nombre y representación de BANKINTER SA se ha presentado, demanda, solicitando se despache ejecución frente a JACQUELINE HERMAN, en base al siguiente título ejecutivo:ESCRITURA DE PRESTAMO CON GARANTÍA HIPOTECARIA formalizada ante Notario de Valencia D. JUAN MANUEL CLEMENTE GONZÁLEZ OTORGADA CON FECHA 30 DE SEPTIEMBRE DE DOS MIL OCHO, bajo número 1.349 de su protocolo.FUNDAMENTOS DE DERECHOPRIMERO.- Examinada la anterior demanda, se estima, a la vista de los datos y documentos aportados, que la parte ejecutante reúne los requisitos de capacidad, representación y postulación procesales, necesarios para comparecer en juicio conforme a lo determinado en los artículos 6, 7, 23, 31 y 538 de la Ley 1/2000, de Enjuiciamiento Civil (LEC).SEGUNDO.- Asimismo, vistas las pretensiones formuladas en la demanda, este Juzgado tiene jurisdicción y competencia objetiva para conocer de las mismas, según los artículos 36, 45, y 545 de la citada ley procesal, siendo igualmente competente territorialmente por aplicación del artículo 684.TERCERO.- Como requiere el artículo 685.2 de la LEC, el título que se presenta, se encuentra revestido de los requisitos que en dicha ley se exige para el despacho de ejecución, por hallarse comprendido en el artículo 517.4 de la misma, cumpliendo la demanda las exigencias del artículo 549, acompañándose de los documentos a que se refiere el artículo 550 , cumpliéndose los demás requisitos y presupuestos procesales previstos en el artículo 551, procediendo por todo ello, despachar la ejecución en los términos solicitados.CUARTO.- Dirigiéndose la ejecución exclusivamente sobre bienes hipotecados en garantía de la deuda por la que se procede y determinándose en la escritura con constitución de hipoteca el precio en que los interesados tasan los bienes hipotecados para que sirva de tipo en la subasta y el domicilio fijado por el deudor para la práctica de los requerimientos y notificaciones, la tramitación de este proceso debe ajustarse a las normas establecidas en el Título IV del Libro III de la LEC, con las especialidades contenidas en su Capítulo V, como establecen los artículos 681 y 682 de dicha ley procesal.PARTE DISPOSITIVASe DESPACHA a instancia de BANKINTER SA ejecución frente a JACQUELINE HERMAN por las siguientes cantidades 131.970,05 de principal, más 39.591,01 presupuestados provisionalmente para gastos, intereses y costas.Expídase Mandamiento al Sr. Registrador de la Propiedad de HUERCAL OVERA, a fin de que remita certificación en la que consten los siguientes extremos:La titularidad del dominio y demás derechos reales del bien hipotecado.Los derechos de cualquier naturaleza que existan sobre el bien hipotecado, en especial relación completa de las cargas inscritas que lo graven o, en su caso, que se halla libre de cargas.Que la hipoteca a favor del ejecutante se halla subsistente y sin cancelar, o, en su caso, la cancelación o modificaciones que aparecieren en el Registro. subsistente y sin cancelar o, en su caso, la cancelación o modificaciones que aparecieren en el Registro.Requiérase al ejecutado a fin de que en el acto haga pago de la cantidades por las que se despacha ejecución.Notifíquese esta resolución al/los ejecutado/s con entrega de copia de demanda ejecutiva y de los documentos acompañados, sin citación ni emplazamiento, para que, en cualquier momento pueda personarse en la ejecución.Tratándose del inmueble hipotecado de la vivienda familiar del ejecutado, de conformidad con lo establecido en el artículo 693.3 de la LEC, comuníquese al mismo que podrá, por una sola vez, aún sin el consentimiento del acreedor, liberar el bien mediante la consignación de la cantidad exacta que por principal e intereses estuviere vencida en la fecha de presentación de la demanda, incrementada, en su caso, con los vencimientos del préstamo y los intereses de demora que se vayan produciendo a lo largo del procedimiento que resulten impagados en todo o en parte.Esta resolución es firme y contra la misma no cabe recurso alguno. (Art. 551.2 LEC), sin perjuicio de que el/los deudor/es pueda/n oponerse a la ejecución despachada dentro de los DIEZ DIAS siguientes a la notificación de este Auto.Lo acuerda y firma el/la JUEZ , doy fe.EL/LA JUEZ EL/LA LETRADO/A DE LAADMINISTRACIÓN DE JUSTICIA"La difusión del texto de esta resolución a partes no interesadas en el proceso en el que ha sido dictada sólo podrá llevarse a cabo previa disociación de los datos de carácter personal que los mismos contuvieran y con pleno respeto al derecho a la intimidad, a los derechos de las personas que requieran un especial deber de tutela o a la garantía del anonimato de las víctimas o perjudicados, cuando proceda.Los datos personales incluidos en esta resolución no podrán ser cedidos, ni comunicados con fines contrarios a las leyes."Huércal-Overa, 10 de enero de 2024.- El/La Letrado/a de la Administración de Justicia, ENCARNACION LARIOS MARTI',
